    [],nt"revision_timestamp": "2016-07-27T23:02:43.641480",nt"name": "predators-in-minnesota-their-role-and-control",nt"isopen":
    false,nt"url": null,nt"notes": "What are the facts about these animals
    in Minnesota? Here also they sometimes prey upon livestock and upon the game we
    like to hunt ourselves. Should they be exterminated? Should they be left alone?
    Or should they be protected? There is no general agreement as to the answers to
    these questions; here or elsewhere. Some states protect the fox so he can be hunted
    during a regular hunting season. Others, like Minnesota, set a bounty on his scalp
    aimed at his extermination. In still other states the fox is regarded as part of
    the landscape and left alone. And what about taking predators that are known to
    be causing damage? How have predator control plans worked out in the past? These
    are all important questions and are questions worth considering.",nt"license_title":
